import React, { useState, useEffect } from 'react'

function App() {
    //declare variable to hold fetch'd data
    const [data, setData] = useState([{}])

    useEffect(
        () => {
            fetch("/time").then(
                res => res.json()
            ).then(
                data => {
                    setData(data)
                    console.log(data)
                }
            )
        }, [])




    return (
        <div>
        </div>
    )
}

export default App
